import React from "react";
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import Login from "./auth/Login";

function Body() {
    return (
        <section>
            <BrowserRouter>
            <Routes>
                <Route path="/login" component={Login} exact />
            </Routes>
            </BrowserRouter>
        </section>
    )
}

export default Body;
